import "./Work.css";
import Navbar from "./Navbar";
import annika from "./images/annika.jpg";

export default function About() {
  return (
    <div className="About">
      <Navbar />
      <h2>Art Scene</h2>{" "}
      <p>
        is a responsive web app created with React that allows people to find
        art exhibitions based on several criteria: distance from them, genre,
        and cost. The app then displays the matching exhibitions on a Google map
        with links to get more info and purchase tickets.
      </p>
    </div>
  );
}
